import './styles/App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <AppProvider>
      <BrowserRouter>
        <Routes>
          {/* <Route path='/' element={ <App /> } /> */}
          <Route path='/login' element={ <Login /> } />
          <Route path='/sign-up' element={ <SignUp /> } />
          <Route path='/tasks' element={ <Tasks /> } />
        </Routes>
      </BrowserRouter>
    </AppProvider>
  );
}

